import "./tip.css"; 
let images = ["image1.jpg", "image2.jpg", "image3.jpg"]; // replace with your images

const tips = () => {
  return (
    <div id="tip">
      <div id="tip-arrow"></div>
      {images.map((image, index) => (
        <img key={index} src={image} alt="tip" />
      ))}
    </div>
  );
};

export default tips
